Chordizer.D=function(b,a){this.addChord(b,"D",0,a).addMute(["LowE","A"]).addOpenString("D").addFretPress(2,["G","HighE"]).addFretPress(3,"H")};Chordizer.D_Fis=function(b,a){this.addChord(b,"D/F#",0,a).addMute(["A"]).addOpenString("D").addFretPress(2,["LowE","G","HighE"]).addFretPress(3,"H")};Chordizer.Dsus2=function(b,a){this.addChord(b,"Dsus2",0,a).addMute(["LowE","A"]).addOpenString(["D","HighE"]).addFretPress(2,"G").addFretPress(3,["H"])};Chordizer.Dsus4=function(b,a){this.addChord(b,"Dsus4",0,a).addMute(["LowE","A"]).addOpenString("D").addFretPress(2,"G").addFretPress(3,["H","HighE"])};Chordizer.Dm=function(b,a){this.addChord(b,"Dm",3,a).addMute(["LowE","A"]).addOpenString("D").addFretPress(1,"HighE").addFretPress(2,"G").addFretPress(3,"H")};